function Navbar() {
  let pathLeft = "/sketch-03";
  let pathRight = "/sketch-05";

  return (
    <>
      {/* <Header /> */}
      <div className="Navbar">
        <div className="canvas"></div>
        <div className="panel">
          <h2 className="skethTitle">sketch-04</h2>
          <div className="optionsList">
            <h3>Option 1</h3>
            <p>slider 1</p>
            <h3>Option 2</h3>
            <p>option 2</p>
            <h3>Option 3</h3>
            <p>option 3</p>
            <h3>Option 4</h3>
            <p>option 4</p>
          </div>
          <button>save as png</button>
        </div>
      </div>
    </>
  );
}

export default Navbar;
